    graph = [set() for _ in range(n + 1)]
    for _ in range(n - 1):
        a, b = [int(x) for x in stdin.strip().split()]
        graph[a].add(b)
        graph[b].add(a)

    # Build a set of all points
    points = set()
    for x in range(1, n + 1):
        points |= graph[x]

    # Build a mapping of points to segments
    points_to_segments = {}
    for p in points:
        segments = []
        for i in range(1, n + 1):
            if p in graph[i]:
                segments.append(i)
        points_to_segments[p] = segments

    # Find the intersection of each segment with each other
    intersections = {}
    for a in points_to_segments:
        intersections[a] = set()
        for b in points_to_segments:
            if a == b:
                continue
            for s1 in points_to_segments[a]:
                for s2 in points_to_segments[b]:
                    if s1 == s2:
                        continue
                    if s1 in intersections[a] or s2 in intersections[b]:
                        continue
                    if s1.intersection(s2):
                        intersections[a].add(s1)
                        intersections[b].add(s2)

    # Get rid of segments with more than k points
    remove = 0
    for p in intersections:
        if len(intersections[p]) > k:
            remove += 1
    return str(remove)

