        B[r][c] = h
        for x, y in (r - 1, c), (r + 1, c), (r, c - 1), (r, c + 1):
            if is_valid(x, y) and A[x][y] < A[r][c]:
                dfs(x, y, h + 1)
    for i in range(m):
        for j in range(n):
            if i == 0 and j == 0:
                continue
            if i == 0:
                dfs(i, j, 1)
            elif j == 0:
                dfs(i, j, A[i][j])
            else:
                dfs(i, j, min(A[i][j], A[i - 1][j], A[i][j - 1], A[i - 1][j - 1]))
    return str(max(map(max, B)))


